  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  outlines Refuge accomplishments from May through August of 1944. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments. Resource management is outlined; topics include grazing,
  haying, and timber removal. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, and violations. N-R forms are attached.\",\n\t\"license_title\":
